import React from 'react'
import '../Pokemon/Pokemon.css'
const Pokemon = ({poke}) => {
    console.log(poke)
    return (
        <div className="poke-detail">
        <h2>Hola</h2>
            {poke && poke.map(p => {
                return(
                <div>
                <h1>{p.name}</h1>
                <h2>Hola!</h2>
                </div>
                )
                
            })}
        </div>
    )
}

export default Pokemon
